import React from 'react'
import { Card, CardCategory, FlexWrapper, StyledCard } from './Styled'
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import { Autoplay, Navigation, Pagination } from "swiper";
import "swiper/css/pagination";
import "swiper/css/navigation";

function Cards() {
  return (
      <Swiper
        slidesPerView={2}
        spaceBetween={2}
        loop={true}
        pagination={{
          clickable: true,
        }}
        navigation={true}
        modules={[Pagination, Navigation, Autoplay]}
      >
        <SwiperSlide>
          <StyledCard>
            <CardCategory>POP</CardCategory>
          </StyledCard>
        </SwiperSlide>
        <SwiperSlide>
          <Card>
            <CardCategory>INDIE</CardCategory>
          </Card>
        </SwiperSlide>
        <SwiperSlide>
          <StyledCard>
            <CardCategory>RAP</CardCategory>
          </StyledCard>
        </SwiperSlide>
        <SwiperSlide>
          <Card>
            <CardCategory>RETRO</CardCategory>
          </Card>
        </SwiperSlide>
      </Swiper>
  );
}

export default Cards
